import React from "react";
import "./Menu.css";
import { Link } from "react-router-dom";

const Menu = ({ open }) => {
  return (
    <ul className={`menu ${open ? "open" : ""}`}>
      <Link to>Home</Link>
      <li>About Us</li>
      <li>Contact Us</li>
      <li>Sign In</li>
      <li>Sign Up</li>
    </ul>
  );
};

export default Menu;
